const StudentContext = React.createContext();

class StudentProvider extends Component {
  constructor(props) {
    super(props);

    this.state = {
      isAuthenticated: props.isAuthenticated,
      email: props.email
    }
  }
  render() {
    return (
      <StudentContext.Provider value={{
        state: this.state
      }}>
        {this.props.children}
      </StudentContext.Provider>
    )
  }
}
